function Navbar() {
    return (
        <header>
            <h3>Logo</h3>
            <nav>
                <a href='/about'>About</a>
                <a href='/resorts'>Resorts</a>
                <button>
                    <FaTimes />
                </button>
            </nav>
            <button>
                <FaBars />
            </button>
        </header>
    )
};

export default Navbar;
